### JavaScript

```javascript
"use strict";

function numUniqueEmails(emails) {
    let s = new Set();
    for (let email of emails) {
        let [local, domain] = email.split('@');
        local = local.replace(/\./g, '');
        let i = local.indexOf('+');
        if (i !== -1) {
            local = local.substring(0, i);
        }
        s.add(local + '@' + domain);
    }
    return s.size;
}
```
